The '''Lumberjack outfit''' is an [[experience-boosting set|experience-boosting clothing set]] that grants additional experience when worn while [[Woodcutting]]. Equipping any piece of the outfit requires 44{{Boostable|no}} Woodcutting.<!--This outfit can be equipped with woodcutting level drained to < 44, while still receiving the experience boost. Cutting trees however requires the boosted woodcutting level of that tree.--> Each piece equipped increases Woodcutting experience by 0.2-0.8% (depends on piece); wearing the complete set grants an additional set bonus of 0.5%, resulting in a total of 2.5% for the entire set. This ''does'' stack with the bonus 10% experience when cutting maples from the [[Kandarin Diary]] medium reward. A particular [[Sherlock#Master%20skill%20challenges|Sherlock master skill challenge]] requires that the full outfit be equipped.

The entire lumberjack outfit can be stored in the [[armour case]] of the [[costume room]] of a [[player-owned house]].

==Obtaining==
Lumberjack clothing can only be obtained as a drop from [[Undead Lumberjack]]s, who can only be found in one random event of the [[Temple Trekking]] [[minigame]]. '''This also includes the reverse minigame Burg de Rott Ramble.''' Once you have completed [[Darkness of Hallowvale]] you have two locations to start the same minigame from, the other being next to Canifis by the fairy ring {{Fairycode|CKS}}. The event occurs when the player is tasked with crossing a bridge in need of repair. The version that needs to occur must have no trees available to cut, meaning the lumberjacks spawn from the swamp water repeatedly and must be slain in order to receive the [[planks]] needed to rebuild the bridge. As long as the bridge is not fully rebuilt and or the dropped planks are not picked up, lumberjacks will continue to spawn and the player can continue to kill them until they receive a piece of the outfit (25% droprate). Players can also repair and cross the bridge, then cross back to cause more lumberjacks to spawn. Note that '''only one piece of the outfit is able to be obtained per event''', although it is possible to get the event multiple times in a single trek.

It should be noted that there is a similar Temple Trekking random event involving repairing a bridge, but there are trees on the map. The Undead Lumberjacks that spawn in this event '''do not''' drop pieces of Lumberjack clothing. The simplest way to differentiate between the two bridge events is that the event that CAN drop clothing will have 0 trees; the event that CANNOT drop clothing will have trees.

The fastest way to obtain the Lumberjack outfit is to take any person through Route One. This enables the player to skip past most combat events. In addition, the player should carry [[slayer ring]]s or [[Kharyrll Teleport]] runes in order to teleport out of the Bog event, and possibly also the sick traveller event, due to the time these events take. It is even faster if players possess the [[Morytania legs 3]] or [[Morytania legs 4|4]], which provides unlimited teleports to [[Burgh de Rott]], allowing players to start a new trek right away. Simply skip all encounters except the relevant bridge event, and if a longer event spawns, you may just teleport back to [[Burgh de Rott]].

If you have completed [[Darkness of Hallowvale]] and have access to the fairy rings, you can also use {{Fairycode|CKS}} to quickly start the minigame at the Burg De Rott Ramble end, and with successful completions, just do the route back and forth between the minigame starting locations.

