==Trivia==
*The examine text for the clothes reads, "You'll certainly be alright wearing these", referring to {{wp|The Lumberjack Song|The Lumberjack Song}} in the British comedy sketch television show {{wp|Monty_Python's_Flying_Circus|Monty Python's Flying Circus}}.
*When you examine lumberjack zombies, it will say “He's the one, but he's not alright” which is another reference to Monty Python’s “Lumberjack song”.

